void Game::DrawLine(int x, int y)
{
	for (int i = 0; i < 30; i++)
	{
		gfx.PutPixel(x, y + i, 255, 255, 255);
		gfx.PutPixel(x+1, y + i, 255, 255, 255);
	}
}


void Game::ComposeFrame()
{
	if (!isStarted && score < 3)
	{
		DrawTitle(325, 211);
	}

	else if (isStarted)
	{
		ball.draw(gfx, 255, 255, 255);
		paddle.draw(gfx, 255, 255, 255);
		AIpaddle.draw(gfx, 255, 255, 255);

		if (score == 1)
		{
			DrawLine(200, 200);
		}
		if (score == 2)
		{
			DrawLine(200, 200);
			DrawLine(220, 200);
		}
		if (score == 3)
		{
			DrawLine(200, 200);
			DrawLine(220, 200);
			DrawLine(240, 200);
			isStarted = false;
		}
	}
	else
	{
		DrawGameOver(400, 300);
	}
	

}
